methods.description:
This helper returns a new property descriptor that wraps the passed
computed property function. You can use this helper to define properties with
native decorator syntax, mixins, or via `defineProperty()`.

Example:

```js
import { computed, set } from '@ember/object';

class Person {
  constructor() {
    this.firstName = 'Betty';
    this.lastName = 'Jones';
  },

  @computed('firstName', 'lastName')
  get fullName() {
    return `${this.firstName} ${this.lastName}`;
  }
}

let client = new Person();

client.fullName; // 'Betty Jones'

set(client, 'lastName', 'Fuller');
client.fullName; // 'Betty Fuller'
```

Classic Class Example:

```js
import EmberObject, { computed } from '@ember/object';

let Person = EmberObject.extend({
  init() {
    this._super(...arguments);

    this.firstName = 'Betty';
    this.lastName = 'Jones';
  },

  fullName: computed('firstName', 'lastName', function() {
    return `${this.get('firstName')} ${this.get('lastName')}`;
  })
});

let client = Person.create();

client.get('fullName'); // 'Betty Jones'

client.set('lastName', 'Fuller');
client.get('fullName'); // 'Betty Fuller'
```

You can also provide a setter, either directly on the class using native class
syntax, or by passing a hash with `get` and `set` functions.

Example:

```js
import { computed, set } from '@ember/object';

class Person {
  constructor() {
    this.firstName = 'Betty';
    this.lastName = 'Jones';
  },

  @computed('firstName', 'lastName')
  get fullName() {
    return `${this.firstName} ${this.lastName}`;
  }

  set fullName(value) {
    let [firstName, lastName] = value.split(/\s+/);

    set(this, 'firstName', firstName);
    set(this, 'lastName', lastName);

    return value;
  }
}

let client = new Person();

client.fullName; // 'Betty Jones'

set(client, 'lastName', 'Fuller');
client.fullName; // 'Betty Fuller'
```

Classic Class Example:

```js
import EmberObject, { computed } from '@ember/object';

let Person = EmberObject.extend({
  init() {
    this._super(...arguments);

    this.firstName = 'Betty';
    this.lastName = 'Jones';
  },

  fullName: computed('firstName', 'lastName', {
    get(key) {
      return `${this.get('firstName')} ${this.get('lastName')}`;
    },
    set(key, value) {
      let [firstName, lastName] = value.split(/\s+/);
      this.setProperties({ firstName, lastName });
      return value;
    }
  })
});

let client = Person.create();
client.get('firstName'); // 'Betty'

client.set('fullName', 'Carroll Fuller');
client.get('firstName'); // 'Carroll'
```

When passed as an argument, the `set` function should accept two parameters,
`key` and `value`. The value returned from `set` will be the new value of the
property.

_Note: This is the preferred way to define computed properties when writing third-party
libraries that depend on or use Ember, since there is no guarantee that the user
will have [prototype Extensions](https://guides.emberjs.com/release/configuring-ember/disabling-prototype-extensions/) enabled._

To get multiple properties at once, call `getProperties`
with an object followed by a list of strings or an array:

```javascript
import { getProperties } from '@ember/object';

getProperties(record, 'firstName', 'lastName', 'zipCode');
// { firstName: 'John', lastName: 'Doe', zipCode: '10011' }
```

is equivalent to:

```javascript
import { getProperties } from '@ember/object';

getProperties(record, ['firstName', 'lastName', 'zipCode']);
// { firstName: 'John', lastName: 'Doe', zipCode: '10011' }
```

NOTE: This is a low-level method used by other parts of the API. You almost
never want to call this method directly. Instead you should use
`mixin()` to define new properties.

Defines a property on an object. This method works much like the ES5
`Object.defineProperty()` method except that it can also accept computed
properties and other special descriptors.

Normally this method takes only three parameters. However if you pass an
instance of `Descriptor` as the third param then you can pass an
optional value as the fourth parameter. This is often more efficient than
creating new descriptor hashes for each property.

## Examples

```javascript
import { defineProperty, computed } from '@ember/object';

// ES5 compatible mode
defineProperty(contact, 'firstName', {
  writable: true,
  configurable: false,
  enumerable: true,
  value: 'Charles'
});

// define a simple property
defineProperty(contact, 'lastName', undefined, 'Jolley');

// define a computed property
defineProperty(contact, 'fullName', computed('firstName', 'lastName', function() {
  return this.firstName+' '+this.lastName;
}));
```

Make a series of property changes together in an
exception-safe way.

```javascript
Ember.changeProperties(function() {
  obj1.set('foo', mayBlowUpWhenSet);
  obj2.set('bar', baz);
});
```

Error-tolerant form of `set`. Will not blow up if any part of the
chain is `undefined`, `null`, or destroyed.

This is primarily used when syncing bindings, which may try to update after
an object has been destroyed.

```javascript
import { trySet } from '@ember/object';

let obj = { name: "Zoey" };
trySet(obj, "contacts.twitter", "@emberjs");
```

Set a list of properties on an object. These properties are set inside
a single `beginPropertyChanges` and `endPropertyChanges` batch, so
observers will be buffered.

```javascript
import EmberObject from '@ember/object';
let anObject = EmberObject.create();

anObject.setProperties({
  firstName: 'Stanley',
  lastName: 'Stuart',
  age: 21
});
```

Creates a new subclass.

```javascript
import EmberObject from '@ember/object';

const Person = EmberObject.extend({
  say(thing) {
    alert(thing);
   }
});
```

This defines a new subclass of EmberObject: `Person`. It contains one method: `say()`.

You can also create a subclass from any existing class by calling its `extend()` method.
For example, you might want to create a subclass of Ember's built-in `Component` class:

```javascript
import Component from '@ember/component';

const PersonComponent = Component.extend({
  tagName: 'li',
  classNameBindings: ['isAdministrator']
});
```

When defining a subclass, you can override methods but still access the
implementation of your parent class by calling the special `_super()` method:

```javascript
import EmberObject from '@ember/object';

const Person = EmberObject.extend({
  say(thing) {
    let name = this.get('name');
    alert(`${name} says: ${thing}`);
  }
});

const Soldier = Person.extend({
  say(thing) {
    this._super(`${thing}, sir!`);
  },
  march(numberOfHours) {
    alert(`${this.get('name')} marches for ${numberOfHours} hours.`);
  }
});

let yehuda = Soldier.create({
  name: 'Yehuda Katz'
});

yehuda.say('Yes');  // alerts "Yehuda Katz says: Yes, sir!"
```

The `create()` on line #17 creates an *instance* of the `Soldier` class.
The `extend()` on line #8 creates a *subclass* of `Person`. Any instance
of the `Person` class will *not* have the `march()` method.

You can also pass `Mixin` classes to add additional properties to the subclass.

```javascript
import EmberObject from '@ember/object';
import Mixin from '@ember/object/mixin';

const Person = EmberObject.extend({
  say(thing) {
    alert(`${this.get('name')} says: ${thing}`);
  }
});

const SingingMixin = Mixin.create({
  sing(thing) {
    alert(`${this.get('name')} sings: la la la ${thing}`);
  }
});

const BroadwayStar = Person.extend(SingingMixin, {
  dance() {
    alert(`${this.get('name')} dances: tap tap tap tap `);
  }
});
```

The `BroadwayStar` class contains three methods: `say()`, `sing()`, and `dance()`.

Creates an instance of a class. Accepts either no arguments, or an object
containing values to initialize the newly instantiated object with.

```javascript
import EmberObject from '@ember/object';

const Person = EmberObject.extend({
  helloWorld() {
    alert(`Hi, my name is ${this.get('name')}`);
  }
});

let tom = Person.create({
  name: 'Tom Dale'
});

tom.helloWorld(); // alerts "Hi, my name is Tom Dale".
```

`create` will call the `init` function if defined during
`AnyObject.extend`

If no arguments are passed to `create`, it will not set values to the new
instance during initialization:

```javascript
let noName = Person.create();
noName.helloWorld(); // alerts undefined
```

NOTE: For performance reasons, you cannot declare methods or computed
properties during `create`. You should instead declare methods and computed
properties when using `extend`.

Augments a constructor's prototype with additional
properties and functions:

```javascript
import EmberObject from '@ember/object';

const MyObject = EmberObject.extend({
  name: 'an object'
});

o = MyObject.create();
o.get('name'); // 'an object'

MyObject.reopen({
  say(msg) {
    console.log(msg);
  }
});

o2 = MyObject.create();
o2.say('hello'); // logs "hello"

o.say('goodbye'); // logs "goodbye"
```

To add functions and properties to the constructor itself,
see `reopenClass`

Augments a constructor's own properties and functions:

```javascript
import EmberObject from '@ember/object';

const MyObject = EmberObject.extend({
  name: 'an object'
});

MyObject.reopenClass({
  canBuild: false
});

MyObject.canBuild; // false
o = MyObject.create();
```

In other words, this creates static properties and functions for the class.
These are only available on the class and not on any instance of that class.

```javascript
import EmberObject from '@ember/object';

const Person = EmberObject.extend({
  name: '',
  sayHello() {
    alert(`Hello. My name is ${this.get('name')}`);
  }
});

Person.reopenClass({
  species: 'Homo sapiens',

  createPerson(name) {
    return Person.create({ name });
  }
});

let tom = Person.create({
  name: 'Tom Dale'
});
let yehuda = Person.createPerson('Yehuda Katz');

tom.sayHello(); // "Hello. My name is Tom Dale"
yehuda.sayHello(); // "Hello. My name is Yehuda Katz"
alert(Person.species); // "Homo sapiens"
```

Note that `species` and `createPerson` are *not* valid on the `tom` and `yehuda`
variables. They are only valid on `Person`.

To add functions and properties to instances of
a constructor by extending the constructor's prototype
see `reopen`

In some cases, you may want to annotate computed properties with additional
metadata about how they function or what values they operate on. For
example, computed property functions may close over variables that are then
no longer available for introspection.

You can pass a hash of these values to a computed property like this:

```javascript
import { computed } from '@ember/object';

person: computed(function() {
  let personId = this.get('personId');
  return Person.create({ id: personId });
}).meta({ type: Person })
```

Once you've done this, you can retrieve the values saved to the computed
property from your class like this:

```javascript
MyClass.metaForProperty('person');
```

This will return the original hash that was passed to `meta()`.

Decorator that turns the target function into an Action which can be accessed
directly by reference.

```js
import Component from '@ember/component';
import { tracked } from '@glimmer/tracking';
import { action } from '@ember/object';

export default class Tooltip extends Component {
  @tracked isShowing = false;

  @action
  toggleShowing() {
    this.isShowing = !this.isShowing;
  }
}
```
```handlebars
<!-- template.hbs -->
<button {{on "click" this.toggleShowing}}>Show tooltip</button>

{{#if isShowing}}
  <div class="tooltip">
    I'm a tooltip!
  </div>
{{/if}}
```

It also binds the function directly to the instance, so it can be used in any
context and will correctly refer to the class it came from:

```js
import Component from '@ember/component';
import { tracked } from '@glimmer/tracking';
import { action } from '@ember/object';

export default class Tooltip extends Component {
  constructor() {
    super(...arguments);

    // this.toggleShowing is still bound correctly when added to
    // the event listener
    document.addEventListener('click', this.toggleShowing);
  }

  @tracked isShowing = false;

  @action
  toggleShowing() {
    this.isShowing = !this.isShowing;
  }
}
```

Specify a method that observes property changes.

```javascript
import EmberObject from '@ember/object';
import { observer } from '@ember/object';

export default EmberObject.extend({
  valueObserver: observer('value', function() {
    // Executes whenever the "value" property changes
  })
});
```

Also available as `Function.prototype.observes` if prototype extensions are
enabled.
